import './daytracker.css'

function Daytracker() {

    const weekday = ["So", "Mo", "Di", "Mi", "Do", "Fr", "Sa"];
    const month = ["January","February","March","April","May","June","July","August","September","October","November","December"];

    const actualDateContainer = new Date();
    const actualDay = actualDateContainer.getDay();
    const actualMonth = actualDateContainer.getMonth();
    const actualYear = actualDateContainer.getFullYear();

    const todayDate = document.getElementById('todayDate');

    if(actualDay < 10) {
        todayDate.innerHTML = weekday[actualDay] + ': ' + '0' +  actualDay + '.' + month[actualMonth] + '.' + actualYear;
    } else {
        todayDate.innerHTML = weekday[actualDay] + ': ' +  actualDay + '.' + month[actualMonth] + '.' + actualYear;
    }

    return(
        <div className='container'>
            <span id='todayDate'>Todaysdate</span>
            <div className='todaysGoal'>
            </div>
        </div>
    )
}

export default Daytracker;
